-- ----------------------------
-- Table structure for easy_area_info
-- ----------------------------
DROP TABLE IF EXISTS `easy_area_info`;
CREATE TABLE `easy_area_info`
(
    `id`                bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
    `parent_name`       varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  DEFAULT '中国' COMMENT '父级名称',
    `parent_code`       varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  DEFAULT '0' COMMENT '父级编码',
    `parent_collection` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '父级编码集合',
    `area_name`         varchar(64) CHARACTER SET utf8mb3 COLLATE utf8_general_ci     DEFAULT NULL COMMENT '名称',
    `area_code`         varchar(64) CHARACTER SET utf8mb3 COLLATE utf8_general_ci     DEFAULT NULL COMMENT '编码',
    `short_name`        varchar(64) CHARACTER SET utf8mb3 COLLATE utf8_general_ci     DEFAULT NULL COMMENT '简称',
    `area_type`         int unsigned                                                  DEFAULT NULL COMMENT '0.省 1.市 2. 区县 3.街道 4.居委会 ',
    `type_code`         int                                                           DEFAULT NULL COMMENT '城乡分类代码',
    `data_year`         int unsigned                                                  DEFAULT NULL COMMENT '行政区划数据年份',
    `create_time`       timestamp       NULL                                          DEFAULT NULL COMMENT '创建时间',
    `update_time`       timestamp       NULL                                          DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
    `remark`            varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
    PRIMARY KEY (`id`) USING BTREE,
    UNIQUE KEY `fk_code_data_year` (`area_code`, `data_year`) USING BTREE COMMENT '区域代码和年份组成唯一',
    KEY `fk_area_code` (`area_code`) USING BTREE COMMENT '区划代码索引',
    KEY `fk_data_year` (`data_year`) USING BTREE COMMENT '数据年份索引',
    KEY `fk_area_type` (`area_type`) USING BTREE COMMENT '行政等级索引'
) ENGINE = InnoDB
  AUTO_INCREMENT = 3386
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='行政区划表';

